import React, { Component } from 'react';
import './App.css';
import axios from 'axios';
import { AuthContextProvider } from './context/AuthContext';
import Router from './Router';

axios.defaults.withCredentials = true;

function App() {
  return (
    <AuthContextProvider>
      <Router/>
    </AuthContextProvider>
  );
}

export default App;
